"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[3206],{3206:function(e){e.exports=JSON.parse('{"en":{"main_title":"Arnolfini portrait","name":"Arnolfini portrait","author":"Jan van Eyck","year":"1434","description":"The subject of the Arnolfini Portrait is domestic: a man and a woman hold hands in an interior setting, with a window behind him and a bed behind her in natural symbolism of fifteenth century marital roles – while husbands went out to engage in business, wives concerned themselves with domestic duties. The clothes the pair are wearing would also have been intended as demonstrative, this time of wealth and social standing."},"ua":{"main_title":"Портрет Арнолфіні","name":"Портрет Арнолфіні","author":"Ян ван Ейк","year":"1434","description":"Тема портрета Арнолфіні домашня: чоловік і жінка тримаються за руки в інтер\'єрі, за ним вікно і ліжко за нею в природному символіці подружніх ролей п\'ятнадцятого століття - в той час як чоловіки йшли займатися бізнесом, дружини займалися домашніми обов\'язками. Одяг, який носить пара, також мав би демонструвати, цього разу багатство та соціальне становище."},"es":{"main_title":"Retrato de Arnolfini","name":"Retrato de Arnolfini","author":"Jan van Eyck","year":"1434","description":"El tema del Retrato de Arnolfini es doméstico: un hombre y una mujer se toman de la mano en un ambiente interior, con una ventana detrás de él y una cama detrás de ella en el simbolismo natural de los roles maritales del siglo XV, mientras los esposos salían a se dedican a los negocios, las esposas se preocupan por las tareas domésticas. La ropa que visten la pareja también habría sido concebida como demostrativa, esta vez de riqueza y posición social."},"specifical":{"authorLink":"jan-van-eyck"}}')}}]);